import React from "react";
import { TextField, Typography, Box, makeStyles, Grid, Button } from "@material-ui/core";

const useStyle = makeStyles({
    header: {
        color: 'white',
        background: "blue"
    }
})
const AddStudent = () => {
    const classes = useStyle();
    return (
        <>
            <Grid item md={6} >
                <Box>
                    <Box>
                        <Typography variant='h5' align='center' className={classes.header} >Add Student </Typography>
                    </Box>
                    <Box pt={4}>
                        <TextField variant='outlined' fullWidth label='Firstname' placeholder='Enter Your First Name' ></TextField>
                    </Box>
                    <Box pt={4}>
                        <TextField variant='outlined' fullWidth label='Lastname' placeholder='Enter Your Last Name' ></TextField>
                    </Box>
                    <Box pt={4}>
                        <TextField variant='outlined' fullWidth label='Email' placeholder='Enter Your Email' required ></TextField>
                    </Box>
                    <Box pt={4}>
                        <Button variant="contained" color="primary" fullWidth>Add</Button>
                    </Box>

                </Box>
            </Grid>
        </>
    );
};

export default AddStudent;
